"use strict";function init(){addEventListener("load",(()=>{highlight()}))}function highlight(){const t=document.querySelectorAll("pre > code");if(0===t.length)return 0;t.forEach((t=>{if(["language-nohighlight","language-plaintext","language-text"].some((e=>t.classList.contains(e))))return 0;t.classList.add("hljs");const e=new Worker("/js/vendor/hljs/worker.min.js");e.onmessage=e=>{t.innerHTML=e.data},e.postMessage(t.textContent)}))}init();